import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Home from "./Home";
import Registration from "./Registration";
import Login from "./Login";
import HostelBook from "./HostelBook";
import ViewAll from "./ViewAll";
import "./App.css";

const App = () => {
  return ( 
    <>
    <Router>
      <div className="header"> 
       <span className="Link2" style={{ textDecoration: 'none' }}><Link to="/">Home</Link></span> 
        <span className="head"> Hostel Management System</span>
       <span className="Link1"><Link to="/register">Registration</Link></span> 
       <span className="Link1"> <Link to="/login">Login</Link></span> 
       <span className="Link1"> <Link to="/bookhostel">Book Hostel</Link></span> 
       <span className="Link1"><Link to="/viewall">All Student</Link></span> 
      </div>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/register">
          <Registration />
        </Route>
        <Route path="/login">
          <Login />
        </Route>
        <Route path="/bookhostel">
          <HostelBook />
        </Route>
        <Route path="/viewall">
          <ViewAll />
        </Route>
      </Switch>
    </Router>
    </>
   );
}

export default App;
